import React from 'react'
import {useState} from 'react'
import styled from 'styled-components'




const App=()=>{

    const [num,setNum]=useState([0,5])

    function incbyone(){

        if(num<150){
            setNum(num+1)
        }
        
    }

    function decbyone(){
        if(num>0){
            setNum(num-1)
        }
        
    }


    return (
        <>

           <Button onClick={decbyone}>-</Button>
           
           <h1>Hello App {num[1]}</h1>
           
           <Button onClick={incbyone}>+</Button>


        </>

    )
}


const Button=styled.button`
   width:50px;
   height:50px;


`;

export default App;
